def getPart(msg, mode):
    msg = msg[1].decode("utf-8") 

    start = 0 
    end = 0 
    final = ''
    try:
        if mode == 'body':
            for i in range(0, len(msg)-5):
                cut = [msg[i], msg[i + 1], msg[i + 2], msg[i + 3], msg[i + 4]]
                if cut == ['d', 'y', '"', ':', '"']:
                    start = i + 5
                    for j in range(start, len(msg)-1):
                        if [msg[j], msg[j + 1]] == ['"', ","]:
                            end = j
            for i in range(start, end):
                final += msg[i]

        if mode == 'sender':
            for i in range(0, len(msg)-5):
                cut = [msg[i], msg[i + 1], msg[i + 2], msg[i + 3], msg[i + 4]]
                if cut == ['l', 'e', '"', ':', '"']:
                    start = i + 5
                    for j in range(start, len(msg)-1):
                        if [msg[j], msg[j + 1]] == ['"', ","]:
                            end = j
                            break
            for i in range(start, end):
                final += msg[i]
        if 'Sent from your Twilio trial account - ' in final:
            tmp = final
            final = ''
            for i in range(38, len(tmp)):
                final += tmp[i]
        return(final)
    
    except IndexError:
        print('unknown notification type')

def giveType(raw):
    msg = str(raw[1].decode("utf-8"))
    if 'ions":[{"th' in msg:
        return('sms')
    if 'client_version' in msg:
        return('email')
    if 'ions":[]}' in msg:
        return('general push')
    if 'ype": "no' in msg:
        return('no noti')
    else:
        return('unknown type')

